                  <div class="mb-2">
                    <label for="exampleInputPassword1" class="form-label">Username</label>
                    <input  name="name" [(ngModel)]="user.name"  type="text" class="form-control" id="exampleInputPassword1" formControlName="password">
                  </div>

                    <div class="mb-2">
                      <label for="exampleInputEmail1" class="form-label">Email address</label>
                      <input name="email" [(ngModel)]="user.email" type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"
                        >

                    </div>
                    <div class="mb-2">
                      <label for="exampleInputPassword1" class="form-label">Password</label>
                      <input  name="password" [(ngModel)]="user.password"  type="password" class="form-control" id="exampleInputPassword1" formControlName="password">
                    </div>

                <div class="mb-2">
                  <label for="exampleInputPassword1" class="form-label">Address</label>
                  <textarea  name="address" [(ngModel)]="user.address"   class="form-control" id="exampleInputPassword1" formControlName="password">
                  </textarea>
                  </div>


                  <div class="text-center py-2">
                    <button type="submit" class="btn  btn-success"  data-bs-dismiss="modal" >Signup</button>
                </div> 
                </form>
